INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1001, 1, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "お！\nあそこに困ってそうな人発見！", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, "春咲 ひより", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1002, 1, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", "大切な人を\n守れるようになりたい…って", "みんなみたいに\nわたしも強くならなきゃ", 0, "草野 優衣", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1003, 1, 0, "少しは磨かれると思いますよ。", "キミに必要な集中力と感性が", "フェンシングを始めてみては？", 0, "士条 怜", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.5, 1004, 1, 0, "みそぎはねぇ、\nかくれんぼやりたい！", "今日はなにして遊ぶ？", "ねぇ、にいちゃん！", 0, "穂高 みそぎ", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1006, 1, 0, "私といっしょに…\nいかない？", "ねぇ…", "風宮あかりです", 0, "風宮 あかり", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.5, 1007, 1, 0, "食べ物の恨みは怖いのー", "プリンたべたいのー", "出雲宮子なのー", 0, "出雲 宮子", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1008, 1, 0, "いいよ。\n見られることは運命さ…", "キミもボクの美貌に\n吸い寄せられたんだね。", "ボクは虹村雪。", 0, "虹村 雪", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1009, 1, 0, "人呼んで「疾風の冥姫」!!", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "フッ…聞いて後悔するがいい！", 0, "柊杏奈", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.5, 1010, 1, 0, "ほんまおおきにやわ～♪", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "マホマホ王国のプリンセス、\nまほ姫どす", 0, "姫宮 真歩", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1011, 1, 0, "ここで会ったが\n100年目～！", "生き別れたお兄ちゃんを探して\n三千世界！", "衣之咲璃乃です！", 0, "衣之咲 璃乃", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1012, 1, 0, "…って、お願い！\n誰にも言わないでおいて～！", "ち、超能力って…\n何のことかな～？", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, "柏崎 初音", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1016, 1, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "一応カリスマ読モJKやってまっす！", "ちょす！\n美波鈴奈だよ～♪", 0, "美波 鈴奈", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1017, 1, 0, "でも、沖縄もとってもいいとこさー", "東京は遊園地みたいなところさー", "はいたーい。\n喜屋武香織さー。", 0, "喜屋武 香織", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1018, 1, 0, "イオちゃんって呼んでね。", "先生って呼ばれるのは\nくすぐったいから", "支倉伊緒です。", 0, "支倉 伊緒", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.5, 1020, 1, 0, "ミミをおいてかないでぇ～", "あ！/\お兄ちゃ～ん\nまってよ～", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, "茜 ミミ", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.5, 1021, 1, 0, "ふぇぇぇぇぇん……", "あの……\nふぇ……", "あ…あの…えっと…\n栗…林…くるみ…です……", 0, "栗林 くるみ", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1022, 1, 0, "なんてありがとうございます！", "こんな私に貴重な時間を\n割いていただき、", "風宮よりです。\nあああああ！", 0, "風宮 より", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.5, 1023, 1, 0, "私こっち行きたいー\nね、早く早くー", "おにいちゃんどこいくの？\nえ？", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, "北条 綾音", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1025, 1, 0, "これて何か違う…\nあああすみません！", "ふ、不束者ですが\nどうぞ末永く…って、", "わっ…わっ…私、\n天野すずめといいます！", 0, "天野 すずめ", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1027, 1, 0, "離しませんわ………\n絶対に…!!", "あなたは…運命の……\n伴侶……", "……クスクス…私は\n…倉石恵理子……", 0, "倉石 恵理子", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1028, 1, 0, "…そうでしょ？？", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, "佐々木 咲恋", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1029, 1, 0, "あはは、\n私もまだまだだなぁ～", "ぇっと…\nキミ、私のこと知らないの?!", "桜井望だよ！\nよろしくねっ", 0, "桜井 望", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1030, 1, 0, "ショーグン、\nワタシと一緒に天下統一デース！", "初めまして、\n私はニノン・ジュベール申すデス！", "デケデケデンっ！", 0, "ニノン・ジュベール", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1031, 1, 0, "おかしいですね……", "でもって私の隣にいるのが……\nえ、見えない？", "上喜しのぶです。\n手元のドクロが父です。", 0, "上喜 しのぶ", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.5, 1033, 1, 0, "そう、\nオラのボケに突っ込める相方が…！", "けんども\nそれには足りないモンが…", "目指すはビッグな\nお笑い芸人だっぺ！", 0, "野戸まひる", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1034, 1, 0, "ちょ\nちょっと一杯飲んできます…！", "ちょっと緊張しちゃって…", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, "綾瀬 ゆかり", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.5, 1036, 1, 0, "これ以上お話しすることは…\nないです！", "知らない人とは話しちゃいけないので", "氷川鏡華…です", 0, "氷川 鏡華", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1038, 1, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "……あ、アラーム。", "柏崎…栞です。", 0, "柏崎 栞", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1040, 1, 0, "野に咲く花が、\n唯一の話相手です。", "私、一人も友達がいなくて……", "ふ、双葉碧です。", 0, "双葉 碧", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1042, 1, 0, "そう思っています。", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "三角千歌です。", 0, "三角 千歌", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1043, 1, 0, "う、疑ってすまなかったな…", "あぁ？\nお前のそいつの仲間か？", "安芸真琴だ。", 0, "安芸 真琴", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1044, 1, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "生けとし生ける全ての者よ！", "わらわこそは夜を総べる者！", 0, "イリヤ・オーンスタイン", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1045, 1, 0, "ｌク、クウカに何かご用ですか!?", "ぐふふふふ……はっ！", "そこで騎士は妖精を乱暴に……", 0, "遠見 空花", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1046, 1, 0, "う～ん…\n猫ってホントに最高にゃ～♪", "自由気ままで♪\n寝て遊んで、食べてケンカして…", "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, "宮坂たまき", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1048, 1, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", "それでは早速クエストに…", "大神美冬よ！", 0, "大神 美冬", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1049, 1, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "クエストもバトルも\n掃除も洗濯も", "星野静流だよ！", 0, "星野静流", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.5, 1050, 1, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "見ての通りの\nセクシー美少女で", "アタシは玉泉美咲。", 0, "玉泉美咲", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.4, 1052, 1, 0, "？？？？", "？？？？", "？？？", 0, "リマ", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.5, 1053, 1, 0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", 0, "モニカ・ヴァイスヴィント", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.5, 1058, 1, 0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", 0, "ペコリーヌ", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.5, 1059, 1, 0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", 0, "コッコロ", 0, 1, 2, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1.5, 1060, 1, 0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", 0, "キャル", 0, 1, 2, 0, 1, 0);
